import React, { Component } from "react";
import styled from "styled-components";


class Inputs extends Component {

    constructor() {
        super();
        this.state = {
          firstName: "mark",
          secondName: "zuckerberg",
          domainName: "fb.com"
}
 this.handleInputChange = this.handleInputChange.bind(this)

}

handleInputChange(e) {
  const firstName = e.target.value
  this.setState({firstName: firstName});
  // this.setState({firstName: firstName});

}

  render() {
    const Div_inputs_outline = styled.div`
    width: 1112px;
    height: 363px;
    margin: 0 auto;
    position: relative;
    top: -624px;
    overflow: hidden;


    `;

  const P_title_beans = styled.p`
  font-family: 'Comfortaa', cursive;
  font-size: 35px;
  font-weight: 700;
  color: #ffffff;
  letter-spacing: 0px;
  margin: 0;
  display: inline;
`;

const P_subtitle_beans = styled.p`
font-family: "Alegreya Sans", sans-serif;
font-size: 20px;
font-weight: 300;
color: #ffffff;
margin: 0;

`;


const Img_beans = styled.img`
// -ms-transform: rotate(-180deg); /* IE 9 */
// -webkit-transform: rotate(-180deg); /* Safari */
// transform: rotate(-180deg); /* Standard syntax */
width: 32px;
    height: 32px;
    `


const Flexbox_Div_inputs = styled.div`
margin-top: 10px;
display: flex;
justify-content: space-around;
position: absolute;
width: 100%
top:122px;

        `


const Input = styled.input`
          width: 229px;
          height: 42px;
          background: transparent;
          border: solid 1px rgba(0, 0, 0, 0.45);
          box-shadow: 0px 0px 0px 1.5px #f8e71c;
          border-radius: 8px;
          display: block;

          font-size: 15px;
          font-weight: normal;
          font-style: normal;
          font-stretch: normal;
          line-height: normal;
          letter-spacing: 0.7px;
          padding-left: 5px;

        `;

const Label = styled.label`
          height: 24px;
          font-size: 16px;
          font-weight: normal;
          font-style: normal;
          font-stretch: normal;
          line-height: normal;
          letter-spacing: 0.7px;
          color: #ffffff;
          display: block;
        `;


const Button_predict = styled.button`
          width: 398px;
          height: 48px;
          border-radius: 10px;
          background-color: rgba(69, 181, 78, 0.99);
          box-shadow: 0 2px 4px 0 rgba(0, 0, 0, 0.29);

        `;

const Div_button = styled.div`
display: flex;
justify-content: center;
position: absolute;
width: 100%
top: 313px;
`

const P_button_text = styled.p`
  font-family: "Alegreya Sans", sans-serif;
  font-size: 16px;
  font-weight: normal;
  font-style: normal;
  font-stretch: normal;
  line-height: normal;
  letter-spacing: 0.7px;
  color: #ffffff;
  margin: 0;
`;




    return (
        <Div_inputs_outline>
         <P_title_beans>beanns</P_title_beans>
         {/* <Img_beans src={require('./Assets/hamster.svg')}/>*/}
        <P_subtitle_beans>an AI for predicting email domains</P_subtitle_beans>

        <Flexbox_Div_inputs>
        <div>
          <Label>FIRST NAME</Label>
          <Input  placeholder="mark" />
        </div>
        <div>
          <Label>SECOND NAME</Label>
          <Input  placeholder="zuckerberg"/>
        </div>
        <div>
          <Label>DOMAIN</Label>
          <Input type="text" placeholder="fb.com"/>
        </div>
        </Flexbox_Div_inputs>

        <Div_button>
        <Button_predict>
        <P_button_text>PREDICT EMAIL</P_button_text>
        </Button_predict>

        </Div_button>


        </Div_inputs_outline>
    );
  }
}

export default Inputs;
